// ModeChoice.js

import React from 'react';

const ModeChoice = ({ question2 }) => {
  return (
    <div>
      <h1>Mode Choice Page</h1>
      {question2 === '<5km' ? (
        <h2>Mode of Transportation: Walk / Bicycle</h2>
      ) : (
        <h2>Mode of Transportation: Metro</h2>
      )}
    </div>
  );
}

export default ModeChoice;
